import React from 'react'
import flavor from './flavor.png'
import garlic from './garlic.png'

const Logo = props => {
    return (
        <div style={styles.container}>
            <img style={styles.garlic} src={garlic} alt="garlic"/>
            <img style={styles.flavor} src={flavor} alt="logo"/>
        </div>
    )
};

export default Logo

const styles = {
    container: {
        display: 'flex',
        flexFlow: 'row'
    },
    flavor: {
        width: '60%',
        margin: '0',
        padding: '0'
    },
    garlic: {
        margin: '0',
        height: '10%'
    }
};
